import LazyLoad from "react-lazyload";
import uuidv4 from "uuid/v4";
import Link from "next/link";

// Home Viwes
import PastPapersPreview from "../home/PastPapersPreview";

const Index = props => {
  return (
    <Layout>
      <Head>
        <title>CXC Spanish | Guide, Past Papers and Exercises</title>
